import { useState, useEffect } from "react";
import "../App.css";
import audio_path from "../data/highlight-5300643.mp3"
const TranscriptDisplay = ({ transcript }) => {
  const [selectedWords, setSelectedWords] = useState([]);
  const [redactedAudio, setRedactedAudio] = useState(null);

  const handleWordClick = (word) => {
    if (selectedWords.includes(word)) {
      // Deselect the word if it's already selected
      setSelectedWords(selectedWords.filter((w) => w !== word));
    } else {
      // Select the word
      setSelectedWords([...selectedWords, word]);
    }
  };

  const clearAll = () => {
    setSelectedWords([]);
  }

  const redact = () => {
    if (selectedWords.length === 0) {
      alert("Please select words to redact.");
      return;
    }

    // Make a POST request to the backend to redact the selected words
    fetch("http://127.0.0.1:5000/api/redact", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ words: selectedWords }),
    })
      .then((response) => {
        if (!response.ok) {
          throw new Error("Failed to generate redacted audio.");
        }
        return response.json();
      })
      .then((data) => {
        alert("Redacted audio successfully created!");
        // Optionally, handle the redacted audio file path
        setRedactedAudio(data.filePath);
        alert(data.filePath)
        console.log("Redacted audio file path:", data.filePath);
      })
      .catch((error) => {
        console.error("Error during redaction:", error);
        alert("An error occurred while redacting the audio.");
      });
  };


  return (
    <div className="transcript-container-scrollable">
      <p>
        {transcript.split(" ").map((word, index) => (
          <span
            key={index}
            onClick={() => handleWordClick(word)}
            style={{
              cursor: "pointer",
              marginRight: "5px",
              color: selectedWords.includes(word) ? "blue" : "black",
              backgroundColor: selectedWords.includes(word) ? "#d0ebff" : "transparent",
              padding: "2px 4px",
              borderRadius: "4px",
            }}
          >
            {word}
          </span>
        ))}
      </p>
      <h3>Transcript Audio</h3>
      <audio controls>
        <source src={"/Users/granthu/VC Prototype/vc/audio-redaction-ui/frontend/src/data/redacted_5300643.mp3"} type="audio/mpeg" />
        Your browser does not support the audio element.
      </audio>
      <div style={{marginTop: "10px"}}>
      {selectedWords.length > 0 && (
        <>
        <p>
          Selected Words: <strong>{selectedWords.join(", ")}</strong>
          </p>
          <button
              onClick={clearAll}
              style={{
                padding: "6px 12px",
                fontSize: "14px",
                backgroundColor: "#ff4d4d",
                color: "white",
                border: "none",
                borderRadius: "4px",
                cursor: "pointer",
              }}
            >
              Clear All
            </button>
            <button
              onClick={redact}
              style={{
                padding: "6px 12px",
                fontSize: "14px",
                backgroundColor: "#ff4d4d",
                color: "white",
                border: "none",
                borderRadius: "4px",
                cursor: "pointer",
              }}
            >
              Redact
            </button>
        </>

      )}
      </div>
       {/* Display the redacted audio */}
       {redactedAudio && (
        <div>
          <h3>Redacted Audio:</h3>
          <audio controls>
            <source src={"/Users/granthu/VC Prototype/vc/audio-redaction-ui/frontend/src/data/highlight-5300643.mp3"} type="audio/mpeg"/>
            Your browser does not support the audio element.
          </audio>
          {redactedAudio} == /Users/granthu/VC Prototype/vc/audio-redaction-ui/frontend/src/data/redacted_5300643.mp3
        </div>
      )}
    </div>
  );
};

// Example usage
const App = () => {
  const [transcript, setTranscript] = useState("");

  useEffect(() => {
    // Fetch the transcript from the Flask backend
    fetch("http://127.0.0.1:5000/api/transcript")
      .then((response) => response.json())
      .then((data) => setTranscript(data.transcript))
      .catch((error) => console.error("Error fetching transcript:", error));
  }, []);

  if (!transcript) return <p>Loading transcript...</p>;

  return (<div className="transcript-container-scrollable">
    <TranscriptDisplay transcript={transcript}></TranscriptDisplay>
  </div>
  );
};

export default App;
